  // Iterate over all nodes, creating layout nodes\n    for (var i = 0; i < layoutInfo.nodeSize; i++) {\n      var tempNode        = {};\n      tempNode.id         = nodes[i].data('id');\n      tempNode.parentId   = nodes[i].data('parent');      \n      tempNode.children   = [];\n      tempNode.positionX  = nodes[i].position('x');\n      tempNode.positionY  = nodes[i].position('y');\n      tempNode.offsetX    = 0;      \n      tempNode.offsetY    = 0;\n      tempNode.height     = nodes[i].height();\n      tempNode.width      = nodes[i].width();\n      tempNode.maxX       = tempNode.positionX + tempNode.width  / 2;\n      tempNode.minX       = tempNode.positionX - tempNode.width  / 2;\n      tempNode.maxY       = tempNode.positionY + tempNode.height / 2;\n      tempNode.minY       = tempNode.positionY - tempNode.height / 2;\n      tempNode.padLeft    = nodes[i]._private.style['padding-left'].pxValue;\n      tempNode.padRight   = nodes[i]._private.style['padding-right'].pxValue;\n      tempNode.padTop     = nodes[i]._private.style['padding-top'].pxValue;\n      tempNode.padBottom  = nodes[i]._private.style['padding-bottom'].pxValue;\n      \n      // Add new node\n      layoutInfo.layoutNodes.push(tempNode);\n      // Add entry to id-index map\n      layoutInfo.idToIndex[tempNode.id] = i;\n    }\n\n    // Inline implementation of a queue, used for traversing the graph in BFS order\n    var queue = [];\n    var start = 0;   // Points to the start the queue\n    var end   = -1;  // Points to the end of the queue\n\n    var tempGraph = [];\n\n    // Second pass to add child information and \n    // initialize queue for hierarchical traversal\n    for (var i = 0; i < layoutInfo.nodeSize; i++) {\n      var n = layoutInfo.layoutNodes[i];\n      var p_id = n.parentId;\n      // Check if node n has a parent node\n      if (null != p_id) {\n      // Add node Id to parent's list of children\n      layoutInfo.layoutNodes[layoutInfo.idToIndex[p_id]].children.push(n.id);\n      } else {\n      // If a node doesn't have a parent, then it's in the root graph\n      queue[++end] = n.id;\n      tempGraph.push(n.id);    \n      }\n    }\n    \n    // Add root graph to graphSet\n    layoutInfo.graphSet.push(tempGraph);\n\n    // Traverse the graph, level by level, \n    while (start <= end) {\n      // Get the node to visit and remove it from queue\n      var node_id  = queue[start++];\n      var node_ix  = layoutInfo.idToIndex[node_id];\n      var node     = layoutInfo.layoutNodes[node_ix];\n      var children = node.children;\n      if (children.length > 0) {\n      // Add children nodes as a new graph to graph set\n      layoutInfo.graphSet.push(children);\n      // Add children to que queue to be visited\n      for (var i = 0; i < children.length; i++) {\n        queue[++end] = children[i];\n      }\n      }\n    }\n\n    // Create indexToGraph map\n    for (var i = 0; i < layoutInfo.graphSet.length; i++) {      \n      var graph = layoutInfo.graphSet[i];\n      for (var j = 0; j < graph.length; j++) {\n      var index = layoutInfo.idToIndex[graph[j]];\n      layoutInfo.indexToGraph[index] = i;\n      }\n    }\n    \n    // Iterate over all edges, creating Layout Edges\n    for (var i = 0; i < layoutInfo.edgeSize; i++) {\n      var e = edges[i];\n      var tempEdge = {};      \n      tempEdge.id       = e.data('id');\n      tempEdge.sourceId = e.data('source');\n      tempEdge.targetId = e.data('target');\n\n      // Compute ideal length\n      var idealLength = options.idealEdgeLength;\n\n      // Check if it's an inter graph edge\n      var sourceIx    = layoutInfo.idToIndex[tempEdge.sourceId];\n      var targetIx    = layoutInfo.idToIndex[tempEdge.targetId];\n      var sourceGraph = layoutInfo.indexToGraph[sourceIx];\n      var targetGraph = layoutInfo.indexToGraph[targetIx];\n\n      if (sourceGraph != targetGraph) {\n      // Find lowest common graph ancestor\n      var lca = findLCA(tempEdge.sourceId, tempEdge.targetId, layoutInfo);\n\n      // Compute sum of node depths, relative to lca graph\n      var lcaGraph = layoutInfo.graphSet[lca];\n      var depth    = 0;\n\n      // Source depth\n      var tempNode = layoutInfo.layoutNodes[sourceIx];\n      while (-1 === $.inArray(tempNode.id, lcaGraph)) {\n        tempNode = layoutInfo.layoutNodes[layoutInfo.idToIndex[tempNode.parentId]];\n        depth++;\n      }\n\n      // Target depth\n      tempNode = layoutInfo.layoutNodes[targetIx];\n      while (-1 === $.inArray(tempNode.id, lcaGraph)) {\n        tempNode = layoutInfo.layoutNodes[layoutInfo.idToIndex[tempNode.parentId]];\n        depth++;\n      }\n\n      logDebug('LCA of nodes ' + tempEdge.sourceId + ' and ' + tempEdge.targetId +  \n         \". Index: \" + lca + \" Contents: \" + lcaGraph.toString() + \n         \". Depth: \" + depth);\n\n      // Update idealLength\n      idealLength *= depth * options.nestingFactor;\n      }\n\n      tempEdge.idealLength = idealLength;\n\n      layoutInfo.layoutEdges.push(tempEdge);\n    }\n\n    // Finally, return layoutInfo object\n    return layoutInfo;\n  };\n\n  \n  /**\n   * @brief : This function finds the index of the lowest common \n   *          graph ancestor between 2 nodes in the subtree \n   *          (from the graph hierarchy induced tree) whose\n   *          root is graphIx\n   *\n   * @arg node1: node1's ID\n   * @arg node2: node2's ID\n   * @arg layoutInfo: layoutInfo object\n   *\n   */\n  var findLCA = function(node1, node2, layoutInfo) {\n    // Find their common ancester, starting from the root graph\n    var res = findLCA_aux(node1, node2, 0, layoutInfo);\n    if (2 > res.count) {\n      // If aux function couldn't find the common ancester, \n      // then it is the root graph\n      return 0;\n    } else {\n      return res.graph;\n    }\n  };\n\n\n  /**\n   * @brief          : Auxiliary function used for LCA computation\n   * \n   * @arg node1      : node1's ID\n   * @arg node2      : node2's ID\n   * @arg graphIx    : subgraph index\n   * @arg layoutInfo : layoutInfo object\n   *\n   * @return         : object of the form {count: X, graph: Y}, where:\n   *                   X is the number of ancesters (max: 2) found in \n   *                   graphIx (and it's subgraphs),\n   *                   Y is the graph index of the lowest graph containing \n   *                   all X nodes\n   */\n  var findLCA_aux = function(node1, node2, graphIx, layoutInfo) {\n    var graph = layoutInfo.graphSet[graphIx];\n    // If both nodes belongs to graphIx\n    if (-1 < $.inArray(node1, graph) && -1 < $.inArray(node2, graph)) {\n      return {count:2, graph:graphIx};\n    }\n\n    // Make recursive calls for all subgraphs\n    var c = 0;\n    for (var i = 0; i < graph.length; i++) {\n      var nodeId   = graph[i];\n      var nodeIx   = layoutInfo.idToIndex[nodeId];\n      var children = layoutInfo.layoutNodes[nodeIx].children;\n\n      // If the node has no child, skip it\n      if (0 === children.length) {\n      continue;\n      }\n\n      var childGraphIx = layoutInfo.indexToGraph[layoutInfo.idToIndex[children[0]]];\n      var result = findLCA_aux(node1, node2, childGraphIx, layoutInfo);\n      if (0 === result.count) {\n      // Neither node1 nor node2 are present in this subgraph\n      continue;\n      } else if (1 === result.count) {\n      // One of (node1, node2) is present in this subgraph\n      c++;\n      if (2 === c) {\n        // We've already found both nodes, no need to keep searching\n        break;\n      }\n      } else {\n      // Both nodes are present in this subgraph\n      return result;\n      }      \n    }\n    \n    return {count:c, graph:graphIx};\n  };\n\n\n  /**\n   * @brief: printsLayoutInfo into js console\n   *         Only used for debbuging \n   */\n  var printLayoutInfo = function(layoutInfo) {\n    if (!DEBUG) {\n      return;\n    }\n    console.debug(\"layoutNodes:\");\n    for (var i = 0; i < layoutInfo.nodeSize; i++) {\n      var n = layoutInfo.layoutNodes[i];\n      var s = \n      \"\\nindex: \"     + i + \n      \"\\nId: \"        + n.id + \n      \"\\nChildren: \"  + n.children.toString() +  \n      \"\\nparentId: \"  + n.parentId  + \n      \"\\npositionX: \" + n.positionX + \n      \"\\npositionY: \" + n.positionY +\n      \"\\nOffsetX: \" + n.offsetX + \n      \"\\nOffsetY: \" + n.offsetY + \n      \"\\npadLeft: \" + n.padLeft + \n      \"\\npadRight: \" + n.padRight + \n      \"\\npadTop: \" + n.padTop + \n      \"\\npadBottom: \" + n.padBottom;\n\n      console.debug(s);    \n    }  \n    \n    console.debug('idToIndex');\n    for (var i in layoutInfo.idToIndex) {\n      console.debug(\"Id: \" + i + \"\\nIndex: \" + layoutInfo.idToIndex[i]);\n    }\n\n    console.debug('Graph Set');\n    var set = layoutInfo.graphSet;\n    for (var i = 0; i < set.length; i ++) {\n      console.debug(\"Set : \" + i + \": \" + set[i].toString());\n    } \n\n    var s = 'IndexToGraph';\n    for (var i = 0; i < layoutInfo.indexToGraph.length; i ++) {\n      s += \"\\nIndex : \" + i + \" Graph: \"+ layoutInfo.indexToGraph[i];\n    }\n    console.debug(s);\n\n    s = 'Layout Edges';\n    for (var i = 0; i < layoutInfo.layoutEdges.length; i++) {\n      var e = layoutInfo.layoutEdges[i];\n      s += \"\\nEdge Index: \" + i + \" ID: \" + e.id + \n      \" SouceID: \" + e.sourceId + \" TargetId: \" + e.targetId + \n      \" Ideal Length: \" + e.idealLength;\n    }\n    console.debug(s);\n\n    s =  \"nodeSize: \" + layoutInfo.nodeSize;\n    s += \"\\nedgeSize: \" + layoutInfo.edgeSize;\n    s += \"\\ntemperature: \" + layoutInfo.temperature;\n    console.debug(s);\n\n    return;\n  };\n\n\n  /**\n   * @brief : Randomizes the position of all nodes\n   */\n  var randomizePositions = function(layoutInfo, cy) {\n    var width     = layoutInfo.clientWidth;\n    var height    = layoutInfo.clientHeight;\n\n    for (var i = 0; i < layoutInfo.nodeSize; i++) {\n      var n = layoutInfo.layoutNodes[i];\n      // No need to randomize compound nodes\n      if (true) {\n        n.positionX = Math.random() * width;\n        n.positionY = Math.random() * height;\n      }\n    }\n  };\n\n  \n  /**\n   * @brief          : Updates the positions of nodes in the network\n   * @arg layoutInfo : LayoutInfo object\n   * @arg cy         : Cytoscape object\n   * @arg options    : Layout options\n   */\n  var refreshPositions = function(layoutInfo, cy, options) {  \n    var s = 'Refreshing positions';\n    logDebug(s);\n\n    var layout = layoutInfo.layout;\n    var nodes = options.eles.nodes();\n    var bb = layoutInfo.boundingBox;\n    var coseBB = { x1: Infinity, x2: -Infinity, y1: Infinity, y2: -Infinity };\n    \n    if( options.boundingBox ){\n      nodes.forEach(function( node ){\n        var lnode = layoutInfo.layoutNodes[layoutInfo.idToIndex[node.data('id')]];\n\n        coseBB.x1 = Math.min( coseBB.x1, lnode.positionX );\n        coseBB.x2 = Math.max( coseBB.x2, lnode.positionX );\n\n        coseBB.y1 = Math.min( coseBB.y1, lnode.positionY );\n        coseBB.y2 = Math.max( coseBB.y2, lnode.positionY );\n      });\n\n      coseBB.w = coseBB.x2 - coseBB.x1;\n      coseBB.h = coseBB.y2 - coseBB.y1;\n    }\n\n    nodes.positions(function(i, ele) {\n      var lnode = layoutInfo.layoutNodes[layoutInfo.idToIndex[ele.data('id')]];\n      s = \"Node: \" + lnode.id + \". Refreshed position: (\" + \n      lnode.positionX + \", \" + lnode.positionY + \").\";\n      logDebug(s);\n\n      if( options.boundingBox ){ // then add extra bounding box constraint\n        var pctX = (lnode.positionX - coseBB.x1) / coseBB.w;\n        var pctY = (lnode.positionY - coseBB.y1) / coseBB.h;\n\n        return {\n          x: bb.x1 + pctX * bb.w,\n          y: bb.y1 + pctY * bb.h\n        };\n      } else {\n        return {\n          x: lnode.positionX,\n          y: lnode.positionY\n        };\n      }\n    });\n\n    // Trigger layoutReady only on first call\n    if (true !== layoutInfo.ready) {\n      s = 'Triggering layoutready';\n      l